import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { TemplateContextProvider } from './context';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <TemplateContextProvider>
      <App />
    </TemplateContextProvider>
  </React.StrictMode>
);
